import React from "react";
import { Grid, GridList, withStyles } from "@material-ui/core";

import Disc from "./Disc/Disc";

const styles = {
  container: {
    height: "calc(100% - 64px)",
    marginTop: 64
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Grid
      container
      justify="center"
      cols={6}
      spacing={24}
      className={classes.container}
    >
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
      <Grid item>
        <Disc />
      </Grid>
    </Grid>
  );
});
